  // Send media message (image, video, document)
  Future<void> sendMediaMessage({
    required String chatId,
    required String content,
    required String mediaUrl,
    required String mediaName,
    required String type,
    required String senderId,
    required String senderEmail,
    required String senderName,
    int? mediaSize,
  }) async {
    try {
      final user = _auth.currentUser;
      if (user == null) {
        print("ERROR: User is not authenticated");
        return;
      }

      // Create message document with media information
      MessageType messageType;
      String? thumbnailUrl;

      switch (type) {
        case 'image':
          messageType = MessageType.image;
          break;
        case 'video':
          messageType = MessageType.video;
          // Generate thumbnail URL for videos
          thumbnailUrl = _cloudinaryService.getVideoThumbnailUrl(mediaUrl);
          break;
        case 'document':
          messageType = MessageType.document;
          break;
        default:
          messageType = MessageType.text;
      }

      final message = MessageModel(
        id: '', // Will be set by Firestore
        senderId: senderId,
        senderEmail: senderEmail,
        senderName: senderName,
        content: content,
        type: messageType,
        timestamp: DateTime.now(),
        mediaUrl: mediaUrl,
        mediaName: mediaName,
        mediaSize: mediaSize,
        thumbnailUrl: thumbnailUrl,
        status: MessageStatus.sent,
      );

      // Add to Firestore
      DocumentReference messageRef = await _firestore
          .collection('chats')
          .doc(chatId)
          .collection('messages')
          .add(message.toMap());

      // Also cache media if it's not in local cache yet
      final mediaCacheService = MediaCacheService();
      mediaCacheService.cacheMessageMedia(
          messageRef.id, chatId, type, mediaUrl);

      // Also cache thumbnail if it exists
      if (thumbnailUrl != null) {
        mediaCacheService.cacheMessageMedia(
            messageRef.id, chatId, 'image', thumbnailUrl,
            isThumbnail: true);
      }

      // Update chat with last message info
      await _firestore.collection('chats').doc(chatId).update({
        'lastMessageAt': message.timestamp,
        'lastMessageText': content,
        'lastMessageSenderId': senderId,
      });

      // Save to local database as well
      await _localDb.saveMessage(
        MessageModel(
          id: messageRef.id,
          senderId: senderId,
          senderEmail: senderEmail,
          senderName: senderName,
          content: content,
          type: messageType,
          timestamp: DateTime.now(),
          mediaUrl: mediaUrl,
          mediaName: mediaName,
          mediaSize: mediaSize,
          thumbnailUrl: thumbnailUrl,
          status: MessageStatus.sent,
        ),
        chatId,
      );

      // Send FCM notification to the receiver
      await _sendMessageNotification(
          chatId, messageRef.id, content, senderId, senderName);
    } catch (e) {
      print("Error sending media message: $e");
      rethrow;
    }
  }
